import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Feather } from '@expo/vector-icons';
import Habits from './Habits';
import Progress from './Progress';
import HabitHistory from './HabitHistory';
import AppSettings from './AppSettings';
import Styles from './Styles';

const ChatBase = () => <View style={{ flex: 1, backgroundColor: "red" }} />
const Tab = createBottomTabNavigator();

export default function BottomTabNav() {
  return (
    <Tab.Navigator style={Styles.bottom_nav} initialRouteName="Habits">
      <Tab.Screen
        name="Habits"
        component={Habits}
        options={{
          tabBarActiveTintColor: '#0066ff',
          headerShown: false,
          tabBarIcon: (tintcolor) => (<Feather name="list" size={24} color={tintcolor.color} />),
        }}
      />
      <Tab.Screen
        name="Progress"
        component={Progress}
        options={{
          tabBarActiveTintColor: '#0066ff',
          headerShown: false,
          tabBarIcon: (tintcolor) => (<Feather name="bar-chart" size={24} color={tintcolor.color} />)
        }}
      />
      <Tab.Screen
        name="History"
        component={HabitHistory}
        options={{
          tabBarActiveTintColor: '#0066ff',
          headerShown: false,
          tabBarIcon: (tintcolor) => (<Feather name="clock" size={24} color={tintcolor.color} />)
        }}
      />
      <Tab.Screen
        name="Profile"
        component={AppSettings}
        options={{
          tabBarActiveTintColor: '#0066ff',
          headerShown: false,
          tabBarIcon: (tintcolor) => (<Feather name="user" size={24} color={tintcolor.color} />)
        }}
      />
      <Tab.Screen
        name="bottomchat"
        /* Pass in a blank component as the base (this never gets shown) */
        component={ChatBase}
        options={{
          tabBarLabel: "Check-in",
          tabBarIcon: ({ size, ...rest }) => (
            <Ionicons name="chatbubble-ellipses-outline" color={getColor(rest)} size={size} />
          ),
        }}
        listeners={({ navigation }) => ({
          tabPress: (e) => {
            e.preventDefault()
            navigation.navigate("chat")
          },
        })}
      />
    </Tab.Navigator>
  );
}
